import './assets/css/font.css';
import './assets/css/Reset.css';
import './App.css';
import { Header } from './Components/Header/Header';
import { Main } from './Components/Page/MainBlock/Main';
import { Contact } from './Components/Page/Contact/Contact';
import { Why } from './Components/Page/Why/Why';
import { Feature } from './Components/Page/Feature/Feature';
import { Gallery } from './Components/Page/Gallery/Gallery';
import { Footer } from './Components/Footer/Footer';

const AnotherComponent = React.lazy(() => import('./Components/Page/Gallery/Gallery'));

function App() {
  return (

      <div className="wrapper">
        <Header />
        <div className="page">
          <Main />
          <Why />
          <Feature />

          <Gallery />
          <Contact />
        </div>
        <Footer />
      </div>

  );
}

export default App;
